        <div>
            <a className="brand" href="/">EZ Tech</a>
        </div>
        <div>
            <a href="/cart">Cart</a>
            <a href="/signin">Sign In</a>
        </div>
    </header>

    <main>

    <Route path='/product/:id' component={ProductScreen}></Route>
    <Route path='/' component={HomeScreen} exact></Route>  

    </main>

